import axios from "axios";
import React, { useState } from 'react';


export default class AuthService {
    getUser(...params) {
        axios({
            method: 'post',
            url: 'http://localhost:4242/api/login',
            data: {
              email: params[0],
              password: params[1]
            }
          }).then(function (response) {

            return response.data.token;

          });
    }
    }
